import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import { IntervalTimer } from "./pages/IntervalTimer";
import { Homepage } from "./pages/Homepage"

function App() {
  return (
    <>
      <Router>
        <Switch>
      <Route path="/timer">
      <IntervalTimer />
      </Route>
      <Route path="/">
        <Homepage />
        </Route>
      </Switch>
      </Router> 
    </>
  );
}

export default App;
